(
	1,1,
	'A. ふぃずばず',
	'<p>FizzBuzzといえば、聞いたことがある方も多いのではないでしょうか。<br>
大まかに説明すると、次のルールで1から順番に数を読み上げていくゲームです。</p>
<ul>
<li>原則として数をそのまま読み上げる。</li>
<li>ただし、3で割り切れる場合は数を読み上げずに Fizz と言う。</li>
<li>5で割り切れる場合は数を読み上げずに Buzz と言う。</li>
<li>3でも5でも割り切れる場合は、上のいずれにも従わず、FizzBuzz と言う。</li></ul>
<p>順番に読み上げるのは飽きてしまったので、 FizzBuzz にランダムアクセスすることにしました。番号を与えられたとき、その番号に相当する読み上げるべきものを出力してください。</p>

<h4>Input</h4>
<pre class=\"source\">N
i1
i2
...
iN
</pre>
<p>1行目に、テストケースの数Nが書いてあります。
2から(N+1)行目には順にそれぞれ読み上げるべき番号が書かれています。</p>

<h4>Output</h4>
<pre class=\"source\">o1
o2
...
oN</pre>
<p>N行それぞれに、書かれた順に入力された番号で読み上げるべきものを書いてください。最後の行にも改行が必要です。</p>

<h4>制約</h4>
<p>1 ≤ N ≤ 1,000<br />
1 ≤ i<sub>1..N</sub> ≤ 1,000,000</p>

<h4>Sample Input</h4>
<pre class=\"source\">5
1
3
413
55
1500
</pre>

<h4>Sample Output</h4>
<pre class=\"source\">1
Fizz
413
Buzz
FizzBuzz
</pre>
	',5,20
),
(
	2,
	1,
	'B. 郵便係',
	'<p>あなたは、郵便物を配送する仕事につきました。<br>
今日も一仕事を終えて拠点に戻ってきましたが、トラックの荷室の奥に一つだけ、配達時間帯指定つきの荷物が残っていることに気付きました。<br>
この荷物を時間内に配送する必要がありますが、トラックが出した最高速度が従業員評価に組み込まれているため、最高速度をなるべく抑えないといけないことを思い出します。トラックは自動運転になっており、速度を指定すると指定した速度で走行しますが、赤信号でのみ停止します。<br>
そのため、なるべく低い速度を指定しつつ、その荷物を指定時刻までに届ける必要があります。幸いなことに、この道はよく通る道で、信号の動きを完璧に把握していますし、それ以外の要因で指定速度より低くなることはありません（加速や減速に要する時間も無視できます）。<br>
この問題を解決するため、配送に使える残り時間（秒）、目的地までの距離（m）、トラックに指定可能な最高速度（m/秒）、各信号の位置と動きを入力（後述）したとき、指定する必要がある速度（m/秒）の最低値を整数で答えるプログラムを書いてください。速度は整数でしか指定できないので、小数で結果が得られたとしても切り上げて回答してください。ただし、トラックに指定可能な最高速度でもなお時間内に到達できない場合は-1と答えてください。<br>
信号の挙動：出発してからx秒後に、この信号は初めて青になります。青になったら、y秒ごとに青と赤を切り替えます。つまり、x+y秒後に赤信号になり、x+2y秒後に再び青になって進むことができるようになります。なお、xはマイナスになることもありますが、その場合も出発後x秒後に青信号になり、その後y秒ごとに信号が切り替わります。</p>

<h4>Input</h4>
<pre class=\"source\">time distance speedlimit
N
location1 x1 y1
...
locationN xN yN
</pre>
<p>1行目：指定所要時間（秒） time、目的地までの距離（m） distance、トラックに指定可能な最高速度（m/秒） speedlimit が順にスペース区切りで入力されています。
2行目：信号の数(N)が入力されています。
3から(2+N)行目：信号の位置（拠点からの距離；m） location<sub>i</sub>、問題文中の信号のパラメータx<sub>i</sub>, y<sub>i</sub> がスペース区切りで入力されています。</p>

<h4>Output</h4>
<pre class=\"source\">speed</pre>
<p>結果は一行で、問題に問われている速度（m/秒で整数、ただし到達できない場合は-1）を出力してください。改行が必要です。</p>

<h4 id=\"content_1_13\">制約</h4>
<p>1 ≤ N ≤ 100<br>
1 ≤ time ≤ 100,000,000<br>
1 ≤ distance ≤ 100,000,000<br>
1 ≤ speedlimit ≤ 100,000,000<br>
1 ≤ location<sub>1..N</sub> ≤ distance<br>
1 ≤ y<sub>1..N</sub> ≤ time<br>
-y<sub>i</sub> ≤ x<sub>i</sub> ≤ y<sub>i</sub> for i in 1..N<br>
location<sub>i-1</sub> ≤ location<sub>i</sub> for i in 2..N
</p>

<h4>Sample Input</h4>
<pre class=\"source\">600 6000 20
3
100 10 20
400 0 30
600 10 45
</pre>
<pre class=\"source\">600 5900 10
1
100 120 200
</pre>

<h4>Sample Output</h4>
<pre class=\"source\">11
</pre>
<pre class=\"source\">-1
</pre>
<p>二つ目の例では、5900m離れたところまで600秒で配送する必要があります。最初の信号が100m離れた地点（残り5800m）にありますが、どんなに速く移動してもここを通過できるのは120秒後ですから、480秒しか残らず、最高速度を以てしても残りの5800mは走破できません。</p>
