	3,
	1,
	'C. 郵便係・続',
	'<p>インターネットを構成する要素としておなじみの IP (Internet Protocol) では、 IP アドレスを元にパケットを目的地に配送します。
例えば家のLANに繋がっているパソコンの場合、LAN内は直接通信できるので直接配送し、LANの外であればデフォルト・ゲートウェイに渡してそこから先の配送を任せます。複数のネットワークに繋がっていれば、宛先によって適切な送り先に渡すことになります。宛先の判定は色々な方法がありますが、この問題ではとてもシンプルなルーティングテーブルを考えます。</p>

<p>今回考えるルーティングテーブルは、次のようなエントリがたくさん集まっています。</p>
<pre class=\"source\">&lt;ネットワークアドレス&gt; &lt;ネットマスク&gt; &lt;宛先インターフェイス&gt; &lt;優先度&gt;</pre>
<p>具体的には例えば以下のようになっています。</p>
<table><tr><th>ネットワークアドレス</th><th>ネットマスク</th><th>宛先インターフェイス</th><th>優先度</th></tr><tr><td>0.0.0.0</td><td>0.0.0.0</td><td>gateway1</td><td>20</td></tr><tr><td>192.168.1.0</td><td>255.255.255.0</td><td>eth0</td><td>10</td></tr><tr><td>192.168.1.0</td><td>255.255.255.0</td><td>eth1</td><td>20</td></tr><tr><td>192.168.1.128</td><td>255.255 255.128</td><td>eth2</td><td>30</td></tr></table>
<p>IPアドレスとネットマスクは、8ビットごとに区切って書かれていますが、実際には32ビットで一続きです。たとえば、 1.2.128.129 は 0x01028081 とも表現できます。
各パケットの宛先IPアドレスと、ルーティングテーブルのエントリのネットマスクの論理積（ビット演算でいう&amp;）がネットワークに一致すれば、そのエントリの宛先インターフェイスがパケットを届けるべきインターフェイスとなります。ただし、複数ある場合は、</p>
<ul><li>ネットマスクが大きい順</li>
<li>ネットマスクも同じ場合は優先度の数字が小さい順</li></ul>
<p>に優先します。</p>
<p>たとえばこの例では、 192.168.1.1 宛なら eth0 に、 192.168.1.130 は eth2 に、 10.0.0.1 宛や 240.0.0.1 宛なら gateway1 に届けます。
実際にはgatewayはインターフェイスではなくて、もう少し情報が書いてあって結局ethのどれかに投げることになるな、と思っている方もいるかと思いますが、ここではgatewayのままにすることにします。</p>

<p>郵便配送の経験を積んだあなたはこのパケットを分配する仕事につきましたが、毎回ルーティングテーブルを目で見て判定するのは効率的でないことに気付きました。仕事を楽にするため、ルーティングテーブルと、パケットの宛先がいくつか入力された時、それぞれのパケットの宛先を出力するプログラムを書いてください。なお、IPアドレスはピリオド区切りではなくスペース区切りで与えられます。</p>

<h4 id=\"content_1_17\">Input</h4>
<pre class=\"source\">N
network1 netmask1 interface1 metrics1
network2 netmask2 interface2 metrics2
...
networkN netmaskN interfaceN metricsN
M
ipaddr1
ipaddr2
...
ipaddrM
</pre>
<p>N, M は整数で、 IPそれぞれルーティングテーブルのエントリの数、パケットの数を示しています。
network, netmask, interface, metrics はそれぞれネットワークアドレス、ネットマスク、宛先インターフェイス、優先度を示しています。
ipaddr は、各パケットの宛先IPアドレスを示しています。
network, netmask, ipaddr はそれぞれ0から255までの整数4つで表現されています。</p>

<h4>Output</h4>
<pre class=\"source\">interface1
interface2
...
interfaceM</pre>
<p>M行にわたり、それぞれの行に順番にそれぞれのパケットの宛先のインターフェイス名を書いてください。最後の行にも改行が必要です。</p>

<h4>制約</h4>
<ul><li>interfaceは10文字までの文字列（含む文字は[a-z0-9]のみ）</li>
<li>優先度は整数（0から100）</li>
<li>network, netmask, metrics のいずれもが重複する行はない</li>
<li>interface が重複する行はない</li>
<li>netmask で 0 になっているビットに相当する network のビットは 0 （つまり network & (~netmask) = 0 ）</li>
<li>必ず一つ以上、 network = netmask = 0 0 0 0 の行がある（つまり、すべてのパケットは宛先がある）。</li>
<li>netmask は全体を2進数で表現したとき、各ビットについてその左のビットが0ならばそのビットも0である（つまり、2進数で表現すると左側に0個以上の1が並び、残りのビットは0で埋まっている)</li>
<li>1 ≤ N ≤ 100</li>
<li>1 ≤ M ≤ 100</li>
</ul>

<h4>Sample Input</h4>
<pre class=\"source\">4
0 0 0 0 0 0 0 0 gateway1 20
192 168 1 0 255 255 255 0 eth0 10
192 168 1 0 255 255 255 0 eth1 20
192 168 1 128 255 255 255 128 eth2 30
7
10 0 0 1
192 168 1 1
192 168 1 123
